import React, { useEffect } from 'react';
import Navbar from './components/Header/Header.jsx';
import HeroSection from './components/HeroSection/HeroSection.jsx';
import FeaturesSection from './LandingPages/WhyChooseSection/WhyChooseSection.jsx';
import UserChoiceSection from './LandingPages/UserChoice/UserChoice.jsx';
import BuyerLogin from "./LandingPages/buyer/Login.jsx";
import SellerLogin from './LandingPages/seller/SellerLogin.jsx';
import HowItWorksSection from './LandingPages/HowItWorks/HowItWorks.jsx';
import Footer from './components/Footer/Footer.jsx';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import './App.css';
import AOS from 'aos';
import 'aos/dist/aos.css';

function LandingPage() {
  return (
    <>
      <Navbar />
      <HeroSection />
      <FeaturesSection />
      <UserChoiceSection />
      <HowItWorksSection />
      <div className="demo-cta" data-aos="fade-up">
        <h3>Still questions ?</h3>
        <button className="demo-btn">
          Request a Demo. <span className="arrow">↗</span>
        </button>
      </div>
      <Footer />
    </>
  );
}

function App() {
  useEffect(() => {
    AOS.init({
      duration: 1000,
      once: true,
    });
  }, []);

  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<LandingPage />} />
          <Route path="/seller-login" element={<SellerLogin />} />
          <Route path="/buyer-login" element={<BuyerLogin />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
